// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./ERC721_flattened.sol";


contract AnimeCrypto is ERC721 {
    address public owner;
    uint256 public countOfUsersRegistered;
    mapping(uint256 => PlayerSpecs) public playersInfo;
    mapping(address => bool) public playerExist;
    uint256 public totalNumberOfCards;
    mapping(uint256 => PowerCardSpecs) public powerCardInfo;
    mapping(uint256 => address) public mappingIdToCards;

    struct PlayerSpecs {
      uint256 playerId;
      uint256 Affinity;
      uint32 CharacterLevel;
    }

    struct PowerCardSpecs {
      string powerName;
      uint32 level;
      uint32 createdAt;
      uint32 timeToNextLevel;
    }

    mapping(address => PlayerSpecs) usersProfileCreated;

    constructor() ERC721("AnimeCrypto", "AC") {
      owner = _msgSender();
    }

    function random(uint256 count) private view returns(uint){
      return uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp, count)))%5;
    }

    function createPlayerProfile() public {
      require(!playerExist[_msgSender()]);
      countOfUsersRegistered++;
      uint256 _random = random(countOfUsersRegistered);
      playersInfo[countOfUsersRegistered] = PlayerSpecs(countOfUsersRegistered, _random, 1);
      playerExist[_msgSender()] = true;
    }

    function fetchCards(address _owner) external view returns(uint256[] memory ownerTokens) {
      uint256 tokenCount = balanceOf(_owner);

      if (tokenCount == 0) {
        return new uint256[](0);
      } else {
        uint256 _tokenId = 0;
        uint256[] memory result = new uint256[](totalNumberOfCards);
        uint256 resultIndex = 0;

        for (_tokenId = 1; _tokenId <= totalNumberOfCards; _tokenId++) {
            if (mappingIdToCards[_tokenId] == _owner) {
                result[resultIndex] = _tokenId;
                resultIndex++;
            }
        }
        return result;
      }
    }

    function createCardsForUser() public {
      require(playerExist[_msgSender()]);
      totalNumberOfCards++;
      _safeMint(_msgSender(), totalNumberOfCards);
      mappingIdToCards[totalNumberOfCards] = _msgSender();
    }
}
